import React from 'react';
import { withContext } from './ReactDims';

const styles = {
  height: '100%',
  backgroundColor: 'red'
};

useEffect(()=>{
    setDimensions(domNode.current.getBoundingClientRect());
},[]);

const ReactNode = ({dims})=>{
  return (
    <div style={styles}>
      width~{dims.width}__ height~{dims.height}
    </div>
  )
};
export default withContext(ReactNode);
